SELECT MIN("dim_date"."d_weeknuminyear") as agg_0, MAX("lineorder"."lo_commitdate" + "dim_date"."d_lastdayinweekfl") as agg_1, AVG("lineorder"."lo_partkey") as agg_2 FROM "supplier" LEFT OUTER JOIN "lineorder" ON "supplier"."s_suppkey" = "lineorder"."lo_suppkey" LEFT OUTER JOIN "part" ON "lineorder"."lo_partkey" = "part"."p_partkey" LEFT OUTER JOIN "customer" ON "lineorder"."lo_custkey" = "customer"."c_custkey" LEFT OUTER JOIN "dim_date" ON "lineorder"."lo_orderdate" = "dim_date"."d_datekey"  WHERE "customer"."c_city" IN ('ROMANIA  4', 'MOZAMBIQU4', 'INDIA    4') AND "lineorder"."lo_revenue" <= 6281512 AND "part"."p_mfgr" != 'MFGR#5'